"use strict";(self.webpackChunk=self.webpackChunk||[]).push([["9180"],{6808:function(s,n,t){t.r(n),t.d(n,{default:()=>e});var d=t(5598);let a=["innerHTML"],e={setup:()=>({html:""}),render:()=>((0,d.wg)(),(0,d.iD)("div",{class:"van-doc-markdown-body",innerHTML:'<h1>AddressList 地址列表</h1>\n<div class="van-doc-card"><h3 id="jie-shao" tabindex="-1">介绍</h3>\n<p>展示地址信息列表。</p>\n</div><div class="van-doc-card"><h3 id="yin-ru" tabindex="-1">引入</h3>\n<p>通过以下方式来全局注册组件，更多注册方式请参考<a href="#/zh-CN/advanced-usage#zu-jian-zhu-ce" target="_blank">组件注册</a>。</p>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { createApp } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> { <span class="hljs-title class_">AddressList</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vant&#x27;</span>;\n\n<span class="hljs-keyword">const</span> app = <span class="hljs-title function_">createApp</span>();\napp.<span class="hljs-title function_">use</span>(<span class="hljs-title class_">AddressList</span>);\n</code></pre>\n</div><h2 id="dai-ma-yan-shi" tabindex="-1">代码演示</h2>\n<div class="van-doc-card"><h3 id="ji-chu-yong-fa" tabindex="-1">基础用法</h3>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">van-address-list</span>\n  <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;chosenAddressId&quot;</span>\n  <span class="hljs-attr">:list</span>=<span class="hljs-string">&quot;list&quot;</span>\n  <span class="hljs-attr">:disabled-list</span>=<span class="hljs-string">&quot;disabledList&quot;</span>\n  <span class="hljs-attr">disabled-text</span>=<span class="hljs-string">&quot;以下地址超出配送范围&quot;</span>\n  <span class="hljs-attr">default-tag-text</span>=<span class="hljs-string">&quot;默认&quot;</span>\n  @<span class="hljs-attr">add</span>=<span class="hljs-string">&quot;onAdd&quot;</span>\n  @<span class="hljs-attr">edit</span>=<span class="hljs-string">&quot;onEdit&quot;</span>\n/&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> { showToast } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vant&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n  <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n    <span class="hljs-keyword">const</span> chosenAddressId = <span class="hljs-title function_">ref</span>(<span class="hljs-string">&#x27;1&#x27;</span>);\n    <span class="hljs-keyword">const</span> list = [\n      {\n        <span class="hljs-attr">id</span>: <span class="hljs-string">&#x27;1&#x27;</span>,\n        <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;张三&#x27;</span>,\n        <span class="hljs-attr">tel</span>: <span class="hljs-string">&#x27;13000000000&#x27;</span>,\n        <span class="hljs-attr">address</span>: <span class="hljs-string">&#x27;浙江省杭州市西湖区文三路 138 号东方通信大厦 7 楼 501 室&#x27;</span>,\n        <span class="hljs-attr">isDefault</span>: <span class="hljs-literal">true</span>,\n      },\n      {\n        <span class="hljs-attr">id</span>: <span class="hljs-string">&#x27;2&#x27;</span>,\n        <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;李四&#x27;</span>,\n        <span class="hljs-attr">tel</span>: <span class="hljs-string">&#x27;1310000000&#x27;</span>,\n        <span class="hljs-attr">address</span>: <span class="hljs-string">&#x27;浙江省杭州市拱墅区莫干山路 50 号&#x27;</span>,\n      },\n    ];\n    <span class="hljs-keyword">const</span> disabledList = [\n      {\n        <span class="hljs-attr">id</span>: <span class="hljs-string">&#x27;3&#x27;</span>,\n        <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;王五&#x27;</span>,\n        <span class="hljs-attr">tel</span>: <span class="hljs-string">&#x27;1320000000&#x27;</span>,\n        <span class="hljs-attr">address</span>: <span class="hljs-string">&#x27;浙江省杭州市滨江区江南大道 15 号&#x27;</span>,\n      },\n    ];\n\n    <span class="hljs-keyword">const</span> <span class="hljs-title function_">onAdd</span> = (<span class="hljs-params"></span>) =&gt; <span class="hljs-title function_">showToast</span>(<span class="hljs-string">&#x27;新增地址&#x27;</span>);\n    <span class="hljs-keyword">const</span> <span class="hljs-title function_">onEdit</span> = (<span class="hljs-params">item, index</span>) =&gt; <span class="hljs-title function_">showToast</span>(<span class="hljs-string">&#x27;编辑地址:&#x27;</span> + index);\n\n    <span class="hljs-keyword">return</span> {\n      list,\n      onAdd,\n      onEdit,\n      disabledList,\n      chosenAddressId,\n    };\n  },\n};\n</code></pre>\n</div><h2 id="api" tabindex="-1">API</h2>\n<div class="van-doc-card"><h3 id="props" tabindex="-1">Props</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>v-model</td>\n<td>当前选中地址的 id，支持多选（类型为 <code>[]</code>）</td>\n<td><em>number | string | number[] | string[]</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>list</td>\n<td>地址列表</td>\n<td><em>AddressListAddress[]</em></td>\n<td><code>[]</code></td>\n</tr>\n<tr>\n<td>disabled-list</td>\n<td>不可配送地址列表</td>\n<td><em>AddressListAddress[]</em></td>\n<td><code>[]</code></td>\n</tr>\n<tr>\n<td>disabled-text</td>\n<td>不可配送提示文案</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>switchable</td>\n<td>是否允许切换地址</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>show-add-button</td>\n<td>是否显示底部按钮</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>add-button-text</td>\n<td>底部按钮文字</td>\n<td><em>string</em></td>\n<td><code>新增地址</code></td>\n</tr>\n<tr>\n<td>default-tag-text</td>\n<td>默认地址标签文字</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>right-icon <code>v4.5.0</code></td>\n<td>右侧图标名称或图片链接，等同于 Icon 组件的 <a href="#/zh-CN/icon#props" target="_blank">name 属性</a></td>\n<td><em>string</em></td>\n<td><code>edit</code></td>\n</tr>\n</tbody>\n</table>\n</div><div class="van-doc-card"><h3 id="events" tabindex="-1">Events</h3>\n<table>\n<thead>\n<tr>\n<th>事件名</th>\n<th>说明</th>\n<th>回调参数</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>add</td>\n<td>点击新增按钮时触发</td>\n<td>-</td>\n</tr>\n<tr>\n<td>edit</td>\n<td>点击编辑按钮时触发</td>\n<td><em>item: AddressListAddress, index: number</em></td>\n</tr>\n<tr>\n<td>select</td>\n<td>切换选中的地址时触发</td>\n<td><em>item: AddressListAddress, index: number</em></td>\n</tr>\n<tr>\n<td>edit-disabled</td>\n<td>编辑不可配送的地址时触发</td>\n<td><em>item: AddressListAddress, index: number</em></td>\n</tr>\n<tr>\n<td>select-disabled</td>\n<td>选中不可配送的地址时触发</td>\n<td><em>item: AddressListAddress, index: number</em></td>\n</tr>\n<tr>\n<td>click-item</td>\n<td>点击任意地址时触发</td>\n<td><em>item: AddressListAddress, index: number, { event }</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="van-doc-card"><h3 id="addresslistaddress-shu-ju-jie-gou" tabindex="-1">AddressListAddress 数据结构</h3>\n<table>\n<thead>\n<tr>\n<th>键名</th>\n<th>说明</th>\n<th>类型</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>id</td>\n<td>每条地址的唯一标识</td>\n<td><em>number | string</em></td>\n</tr>\n<tr>\n<td>name</td>\n<td>姓名</td>\n<td><em>string</em></td>\n</tr>\n<tr>\n<td>tel</td>\n<td>手机号</td>\n<td><em>number | string</em></td>\n</tr>\n<tr>\n<td>address</td>\n<td>详细地址</td>\n<td><em>string</em></td>\n</tr>\n<tr>\n<td>isDefault</td>\n<td>是否为默认地址</td>\n<td><em>boolean</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="van-doc-card"><h3 id="slots" tabindex="-1">Slots</h3>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>说明</th>\n<th>参数</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>default</td>\n<td>在列表下方插入内容</td>\n<td>-</td>\n</tr>\n<tr>\n<td>top</td>\n<td>在顶部插入内容</td>\n<td>-</td>\n</tr>\n<tr>\n<td>item-bottom</td>\n<td>在列表项底部插入内容</td>\n<td><em>item: AddressListAddress</em></td>\n</tr>\n<tr>\n<td>tag</td>\n<td>自定义列表项标签内容</td>\n<td><em>item: AddressListAddress</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="van-doc-card"><h3 id="lei-xing-ding-yi" tabindex="-1">类型定义</h3>\n<p>组件导出以下类型定义：</p>\n<pre><code class="language-ts"><span class="hljs-keyword">import</span> <span class="hljs-keyword">type</span> { <span class="hljs-title class_">AddressListProps</span>, <span class="hljs-title class_">AddressListAddress</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vant&#x27;</span>;\n</code></pre>\n</div><h2 id="zhu-ti-ding-zhi" tabindex="-1">主题定制</h2>\n<div class="van-doc-card"><h3 id="yang-shi-bian-liang" tabindex="-1">样式变量</h3>\n<p>组件提供了下列 CSS 变量，可用于自定义样式，使用方法请参考 <a href="#/zh-CN/config-provider" target="_blank">ConfigProvider 组件</a>。</p>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>默认值</th>\n<th>描述</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>--van-address-list-padding</td>\n<td><em>var(--van-padding-sm) var(--van-padding-sm) 80px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-disabled-text-color</td>\n<td><em>var(--van-text-color-2)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-disabled-text-padding</td>\n<td><em>var(--van-padding-base) * 5 0 var(--van-padding-md)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-disabled-text-font-size</td>\n<td><em>var(--van-font-size-md)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-disabled-text-line-height</td>\n<td><em>var(--van-line-height-md)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-add-button-z-index</td>\n<td><em>999</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-item-padding</td>\n<td><em>var(--van-padding-sm)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-item-text-color</td>\n<td><em>var(--van-text-color)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-item-disabled-text-color</td>\n<td><em>var(--van-text-color-3)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-item-font-size</td>\n<td><em>13px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-item-line-height</td>\n<td><em>var(--van-line-height-sm)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-radio-color</td>\n<td><em>var(--van-primary-color)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--van-address-list-edit-icon-size</td>\n<td><em>20px</em></td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div>'},null,8,a))}}}]);